The first point that is important to mention when it comes to variables in the Bleach language is that all of them are mutable. Which means that, once a variable is declared, the programmer is allowed to perform any amount of assignments later on the program that is being written. The second point that must be mentioned is that there is no concept of constants in Bleach. There are just mutable variables, as explained above. The third point is that, in order to declare a new variable in Bleach, the programmer must use the let keyword: let variable = "A str value"; The fourth one is that, if during the declaration of a variable, an initializer is not provided, then, by default, the variable will store the nil value inside itself: let someVariable;
print someVariable; // nil The last point, and maybe the most important of them all, is that since Bleach is a dynamically-typed programming language, its variables don't have types associated with them. Instead, it's the values that have types. The most important implication of this is that a variable can hold a value of any type at different points in time. In practice, Bleach allows the code snippet below with no problems: let a = "hello";
print a; // "hello" a = 42;
print a; // 42

