In case you are not familiar (or don't remember), variable shadowing is a process that commonly happens in programming. It's an effect where a variable declared within a certain scope (typically a local scope) has the same name as a variable in an outer scope. Then, the inner variable "shadows" or "hides" the outer variable within the scope where it is declared, meaning that within that scope, the inner variable takes precedence, and the outer variable cannot be directly accessed. The shadowing effect occurs because, before the program actually starts its execution, usually compilers an interpreters (and this includes the Bleach interpreter) do a static-time pass through the source code called "resolving". In this pass, variables are resolved by searching through scopes, starting from the innermost scope and moving outward. If a variable is found in an inner scope with the same name as one in an outer scope, the inner variable is used, effectively "shadowing" the outer one. Pay attention to the fact that the shadowing effect is limited to the scope of the inner variable. Once the program exits that scope, the outer variable becomes "visible" to the program again. The example below shows a clear example of variable shadowing: let a = 42; print a; // 42 { let a = "Hello, there!"; print a; // "Hello, there!" --> In this scope, the variable a that holds the value "Hello, there!" hides the other one that has the same name but stores a different value: 42.
} print a; // 42 Another example, now involving functions: let foo = "hi"; print foo; // "hi" function f(){ let foo = 42; print foo; // 42; return;
} f(); print foo; // "hi"

