The if statement is one of the fundamental control flow structures in programming. It allows the program to execute a block of code only if a specified condition is true. If the condition is false, then the code block associated to the if is not executed, and alternative blocks of code can be executed by using elif clauses or an else clause. Remember that, during runtime, the clauses of an if statement are evaluated from top to bottom. Also, once the condition of a clause is met, its associated block will be executed and then the rest of clauses won't even be looked at by the interpreter. Instead, it goes straight forward to the next statement. Bleach is no exception in this matter. Also remember that is completely possible to nest an infinite amount of if statements in a program. Bleach can handle such scenarios with no issues. It's important to mention that one does not need to add a block after an if, elif or else clause. This means that the code snippet below executes without any problems: let foo = "hi"; if(foo == "hi") print "Found a 'hi' string!";
elif(foo == "oi") print "Fount an 'oi' string!";
else print "Found something else inside the 'foo' variable"; Last but not least, Bleach, different from some other programming languages, allows the programmers to declare variables inside the code blocks associated to the clauses of an if statement. If you do this, you must keep in mind that the scope of such variable will be restricted to the block associated to the specific clause. Simple example of a code snippet that uses an if statement: let number = 2; if(number == 3){ print "The value of 'number' is 3.";
}elif(number == 2){ print "The value of 'number' is 2."; // "The value of 'number' is 2."
}else{ print "The value of 'number is something else.";
} Another example of a code snippet that also uses an if statement. However, now there are nested if statements: let n = 42;
let s = "Meaning of life"; if(n == 42){ if(s == "Meaning of life"){ print "The value of n is 42 and the value of s is not 'Meaning of life'"; }else{ print "The value of n is 42 and the value of s is not 'Meaning of life'"; }
}else{ print "The value of n is not 42";
}

