This is another a type of control flow structure very similar to the while loop present above and that is ubiquitous in programming languages. A do-while executes a block of code at least once before checking its condition. That is key difference between a do-while loop and a regular while loop: the condition in a do-while loop is checked after the loop’s code has executed, not before. This guarantees that the loop’s code will always run at least once, even if the condition evaluates to the false value. This might sound problematic, but there are some niche scenarios where this behavior comes in handy. Another thing that is important to mention is that, as the programmer could use a variable of any type as the condition of a while loop, he/she/they can do the same thing in a do-while loop. As we've seen, each value, no matter its type is considered either "truthy" or "falsey". In practice, this means that you don't need to necessarily only use values of type bool or expressions that evaluate to such type. Last, but not least, as the while loops require, the do-while loops in Bleach need a block between the keywords do and while. In practice, this means that the following code snippet will not even execute: let counter = 0; do counter = counter + 1;
while(counter < 10); On the other hand, the following one will execute without any issues: let counter = 0; do{ counter = counter + 1;
}while(counter < 10);
